"use client"

import { useState, useEffect } from "react"
import {
  Play,
  Clock,
  CheckCircle,
  XCircle,
  Loader,
  Trash2,
  Zap,
  Activity,
  TrendingUp,
  AlertTriangle,
  BarChart3,
  Settings,
  Rocket,
  Timer,
  Target,
} from "lucide-react"
import { Line } from "react-chartjs-2"
import { Card, CardContent, CardDescription, CardHeader, CardTitle } from "@/components/ui/card"
import { Button } from "@/components/ui/button"
import { Input } from "@/components/ui/input"
import { Label } from "@/components/ui/label"
import { Select, SelectContent, SelectItem, SelectTrigger, SelectValue } from "@/components/ui/select"
import { Badge } from "@/components/ui/badge"
import { Alert, AlertDescription } from "@/components/ui/alert"
import { Separator } from "@/components/ui/separator"
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from "chart.js"

// Register ChartJS components
ChartJS.register(CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend)

const API_BASE_URL = process.env.REACT_APP_API_URL

// API functions
const api = {
  createJob: async (jobType, inputData) => {
    const response = await fetch(`${API_BASE_URL}/simulation`, {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(inputData),
    })

    if (!response.ok) {
      const error = await response.json()
      throw new Error(error.error || "Failed to create job")
    }

    const data = await response.json()
    console.log("Created job:", data)
    return data
  },

  listJobs: async (jobType) => {
    const response = await fetch(`${API_BASE_URL}/simulation`)
    if (!response.ok) {
      throw new Error("Failed to fetch jobs")
    }
    const data = await response.json()
    console.log("Listed jobs:", data)
    return data.jobs
  },

  deleteJob: async (jobType, jobId) => {
    const response = await fetch(`${API_BASE_URL}/simulation/${jobId}`, {
      method: "DELETE",
    })
    if (!response.ok) {
      throw new Error("Failed to delete job")
    }
    console.log("Deleted job:", jobId)
  },
}

// Validation functions
const validateSimulateInputs = (
  terrainSize,
  noise,
  smoothness,
  maxIterations,
  depthBounds,
  volumeBounds,
  monetaryLimit,
  timeLimit,
) => {
  const errors = {}

  if (!terrainSize || terrainSize < 100 || terrainSize > 1000) {
    errors.terrainSize = "Terrain size must be between 100 and 1000"
  }

  if (noise === null || noise === undefined || noise < 0 || noise > 1) {
    errors.noise = "Noise level must be between 0 and 1"
  }

  if (smoothness === null || smoothness === undefined || smoothness <= 0) {
    errors.smoothness = "Smoothness must be greater than 0"
  }

  if (maxIterations && (maxIterations < 1 || maxIterations > 1000)) {
    errors.maxIterations = "Max iterations must be between 1 and 1000"
  }

  if (depthBounds && (depthBounds[0] >= depthBounds[1] || depthBounds[0] < 0)) {
    errors.depthBounds = "Invalid depth bounds: min must be less than max and non-negative"
  }

  if (volumeBounds && (volumeBounds[0] >= volumeBounds[1] || volumeBounds[0] < 0)) {
    errors.volumeBounds = "Invalid volume bounds: min must be less than max and non-negative"
  }

  if (monetaryLimit && monetaryLimit <= 0) {
    errors.monetaryLimit = "Monetary limit must be greater than 0"
  }

  if (timeLimit && timeLimit <= 0) {
    errors.timeLimit = "Time limit must be greater than 0"
  }

  return {
    isValid: Object.keys(errors).length === 0,
    errors,
  }
}

const StatusBadge = ({ status }) => {
  const configs = {
    pending: {
      variant: "secondary",
      icon: Clock,
      pulse: false,
    },
    running: {
      variant: "default",
      icon: Loader,
      pulse: true,
    },
    completed: {
      variant: "default",
      icon: CheckCircle,
      pulse: false,
      className: "bg-emerald-500 hover:bg-emerald-600",
    },
    failed: {
      variant: "destructive",
      icon: XCircle,
      pulse: false,
    },
  }

  const config = configs[status]
  const IconComponent = config.icon

  return (
    <Badge variant={config.variant} className={`${config.className || ""} flex items-center gap-1`}>
      <IconComponent className={`w-3 h-3 ${config.pulse ? "animate-spin" : ""}`} />
      {status.charAt(0).toUpperCase() + status.slice(1)}
    </Badge>
  )
}

const SimulationProgress = ({ metrics }) => {
  if (!metrics) return null

  console.log("Received metrics:", metrics)

  const xLabels = Array.isArray(metrics.wellsPlaced) ? metrics.wellsPlaced.map((_, index) => `Well ${index + 1}`) : []

  const chartData = {
    labels: xLabels,
    datasets: [
      {
        label: "Progress MSE",
        data: Array.isArray(metrics.meanSquaredError) ? metrics.meanSquaredError : [],
        borderColor: "hsl(var(--primary))",
        backgroundColor: "hsl(var(--primary) / 0.1)",
        tension: 0.4,
        yAxisID: "y",
        fill: true,
      },
      {
        label: "Monetary Cost ($)",
        data: Array.isArray(metrics.monetaryCost) ? metrics.monetaryCost : [],
        borderColor: "hsl(var(--destructive))",
        backgroundColor: "hsl(var(--destructive) / 0.1)",
        tension: 0.4,
        yAxisID: "y1",
        fill: true,
      },
    ],
  }

  const options = {
    responsive: true,
    maintainAspectRatio: false,
    interaction: {
      mode: "index",
      intersect: false,
    },
    plugins: {
      legend: {
        position: "top",
        labels: {
          usePointStyle: true,
          padding: 20,
          font: {
            size: 12,
          },
        },
      },
      title: {
        display: true,
        text: "Simulation Progress (Final error uses weighted MSE)",
        font: {
          size: 14,
        },
      },
    },
    scales: {
      x: {
        title: {
          display: true,
          text: "Wells Placed",
        },
        grid: {
          color: "hsl(var(--border))",
        },
      },
      y: {
        type: "linear",
        display: true,
        position: "left",
        title: {
          display: true,
          text: "Mean Squared Error",
        },
        grid: {
          color: "hsl(var(--border))",
        },
      },
      y1: {
        type: "linear",
        display: true,
        position: "right",
        title: {
          display: true,
          text: "Monetary Cost ($)",
        },
        grid: {
          drawOnChartArea: false,
        },
      },
    },
  }

  return (
    <div className="w-full h-80 p-4">
      <Line data={chartData} options={options} />
    </div>
  )
}

const JobCard = ({ job, onDelete }) => {
  const [progressMetrics, setProgressMetrics] = useState(null)
  const [inputData, setInputData] = useState(null)
  const [results, setResults] = useState(null)
  const [currentJob, setCurrentJob] = useState(job)

  useEffect(() => {
    setCurrentJob(job)
  }, [job])

  useEffect(() => {
    let interval
    let finished = false
    const fetchJob = async () => {
      try {
        const response = await fetch(`${process.env.REACT_APP_API_URL}/simulation/${currentJob.id}`)
        if (response.ok) {
          const updatedJob = await response.json()
          setCurrentJob(updatedJob)
          if (updatedJob.progress) {
            setProgressMetrics(updatedJob.progress)
          }
          if (updatedJob.result) {
            setResults(updatedJob.result)
          }
          if ((updatedJob.status === "completed" || updatedJob.status === "failed") && !finished) {
            finished = true
            clearInterval(interval)
            setTimeout(fetchJob, 0)
          }
        }
      } catch (err) {
        // Handle error silently
      }
    }
    if (currentJob && currentJob.status === "running") {
      fetchJob()
      interval = setInterval(fetchJob, 1000)
    }
    return () => clearInterval(interval)
  }, [currentJob])

  useEffect(() => {
    if (currentJob) {
      if (currentJob.progress) {
        setProgressMetrics(currentJob.progress)
      }
      if (currentJob.input_data) {
        setInputData(currentJob.input_data)
      }
      if (currentJob.result) {
        setResults(currentJob.result)
      }
    }
  }, [currentJob])

  const getRuntime = () => {
    if (!job.started_at || !job.completed_at) return "N/A"
    const start = new Date(job.started_at)
    const end = new Date(job.completed_at)
    const diff = end.getTime() - start.getTime()
    return `${Math.round(diff / 1000)}s`
  }

  const formatDate = (dateStr) => {
    if (!dateStr) return "N/A"
    return new Date(dateStr).toLocaleString()
  }

  if (!job) return null

  return (
    <Card className="mb-6 overflow-hidden border-gray-700/50 shadow-2xl bg-gradient-to-br from-gray-800 to-gray-900">
      <CardHeader className="pb-4">
        <div className="flex justify-between items-start">
          <div className="space-y-2">
            <div className="flex items-center gap-3">
              <div className="w-10 h-10 bg-gradient-to-br from-blue-500 to-purple-600 rounded-lg flex items-center justify-center">
                <Rocket className="w-5 h-5 text-white" />
              </div>
              <div>
                <CardTitle className="text-lg text-white">Simulation Job {job.id}</CardTitle>
                <CardDescription className="text-gray-400">
                  Created: {job.created_at ? formatDate(job.created_at) : "N/A"}
                </CardDescription>
              </div>
            </div>
            {job.parameters && job.parameters.algorithm && (
              <Badge variant="outline" className="w-fit">
                <Settings className="w-3 h-3 mr-1" />
                Algorithm: {job.parameters.algorithm.charAt(0).toUpperCase() + job.parameters.algorithm.slice(1)}
              </Badge>
            )}
          </div>
          <div className="flex items-center gap-2">
            <StatusBadge status={job.status} />
            <Button
              variant="ghost"
              size="sm"
              onClick={() => onDelete(job.id)}
              className="text-muted-foreground hover:text-destructive"
            >
              <Trash2 className="w-4 h-4" />
            </Button>
          </div>
        </div>
      </CardHeader>

      <CardContent className="space-y-6">
        {job.status === "running" && (
          <div className="flex items-center gap-2 text-sm text-blue-300 bg-blue-900/30 p-3 rounded-lg border border-blue-700/50">
            <Timer className="w-4 h-4" />
            Running for {getRuntime()}
          </div>
        )}

        {job.status === "running" && job.parameters && (
          <div className="space-y-3">
            <h4 className="font-semibold text-sm flex items-center gap-2 text-gray-200">
              <Target className="w-4 h-4" />
              Input Parameters
            </h4>
            <div className="grid grid-cols-2 gap-3 text-sm">
              {Object.entries(job.parameters).map(([key, value]) => (
                <div key={key} className="flex justify-between p-2 bg-gray-700/50 rounded">
                  <span className="font-medium text-gray-400">{key}:</span>
                  <span className="text-gray-200">
                    {Array.isArray(value) ? `[${value.join(", ")}]` : String(value)}
                  </span>
                </div>
              ))}
            </div>
          </div>
        )}

        {inputData && (
          <div className="space-y-3">
            <h4 className="font-semibold text-sm flex items-center gap-2 text-gray-200">
              <BarChart3 className="w-4 h-4" />
              Input Data
            </h4>
            <div className="grid grid-cols-2 gap-4">
              <div className="space-y-2">
                <div className="flex justify-between text-sm">
                  <span className="text-gray-400">Terrain Size:</span>
                  <span className="font-medium text-gray-200">{inputData.terrainSize}</span>
                </div>
                <div className="flex justify-between text-sm">
                  <span className="text-gray-400">Noise Level:</span>
                  <span className="font-medium text-gray-200">{inputData.noise}</span>
                </div>
                <div className="flex justify-between text-sm">
                  <span className="text-gray-400">Smoothness:</span>
                  <span className="font-medium text-gray-200">{inputData.smoothness}</span>
                </div>
              </div>
              <div className="space-y-2">
                <div className="flex justify-between text-sm">
                  <span className="text-gray-400">Max Iterations:</span>
                  <span className="font-medium text-gray-200">{inputData.maxIterations}</span>
                </div>
                <div className="flex justify-between text-sm">
                  <span className="text-gray-400">Depth Bounds:</span>
                  <span className="font-medium">
                    [{inputData.depthBounds[0]}, {inputData.depthBounds[1]}]
                  </span>
                </div>
                <div className="flex justify-between text-sm">
                  <span className="text-gray-400">Volume Bounds:</span>
                  <span className="font-medium">
                    [{inputData.volumeBounds[0]}, {inputData.volumeBounds[1]}]
                  </span>
                </div>
              </div>
            </div>
          </div>
        )}

        {progressMetrics && (
          <div className="space-y-3">
            <h4 className="font-semibold text-sm flex items-center gap-2 text-gray-200">
              <Activity className="w-4 h-4" />
              Progress
            </h4>
            {job.status === "completed" &&
              Array.isArray(progressMetrics.meanSquaredError) &&
              progressMetrics.meanSquaredError.length > 0 && (
                <div className="p-3 bg-emerald-900/30 border border-emerald-700/50 rounded-lg">
                  <p className="text-sm font-medium text-emerald-300">
                    Final Error:{" "}
                    {progressMetrics.meanSquaredError[progressMetrics.meanSquaredError.length - 1].toFixed(4)}
                  </p>
                </div>
              )}
            <div className="border border-gray-700 rounded-lg bg-gray-800/50">
              <SimulationProgress metrics={progressMetrics} />
            </div>
          </div>
        )}

        {results && (
          <div className="space-y-3">
            <h4 className="font-semibold text-sm flex items-center gap-2 text-gray-200">
              <CheckCircle className="w-4 h-4" />
              Results
            </h4>
            <div className="grid grid-cols-2 gap-4">
              <div className="space-y-2">
                <div className="flex justify-between text-sm">
                  <span className="text-gray-400">Wells Placed:</span>
                  <span className="font-medium text-gray-200">
                    {results.terrain_summary && typeof results.terrain_summary.totalWells === "number"
                      ? results.terrain_summary.totalWells
                      : "N/A"}
                  </span>
                </div>
              </div>
              <div className="space-y-2">
                <div className="flex justify-between text-sm">
                  <span className="text-gray-400">Total Cost:</span>
                  <span className="font-medium text-gray-200">
                    {results.terrain_summary && typeof results.terrain_summary.monetaryCost === "number"
                      ? `$${results.terrain_summary.monetaryCost.toFixed(2)}`
                      : "N/A"}
                  </span>
                </div>
                <div className="flex justify-between text-sm">
                  <span className="text-gray-400">Total Time:</span>
                  <span className="font-medium text-gray-200">
                    {results.terrain_summary && typeof results.terrain_summary.timeCost === "number"
                      ? `${results.terrain_summary.timeCost.toFixed(2)} units`
                      : "N/A"}
                  </span>
                </div>
              </div>
            </div>
          </div>
        )}

        {job.error && (
          <Alert variant="destructive">
            <AlertTriangle className="h-4 w-4" />
            <AlertDescription>
              <strong>Error:</strong> {job.error}
            </AlertDescription>
          </Alert>
        )}

        {job.parameters && (job.parameters.algorithm === "genetic" || job.parameters.algorithm === "geneticSingle") && (
          <div className="p-4 bg-blue-900/30 border border-blue-700/50 rounded-lg space-y-3">
            <h4 className="font-semibold text-sm text-blue-300 flex items-center gap-2">
              <Settings className="w-4 h-4" />
              Genetic Algorithm Parameters
            </h4>
            <div className="grid grid-cols-2 gap-3 text-sm">
              <div className="flex justify-between">
                <span className="text-blue-400">Num Generations:</span>
                <span className="font-medium text-blue-200">{job.parameters.numGenerations}</span>
              </div>
              <div className="flex justify-between">
                <span className="text-blue-400">Mutation Rate:</span>
                <span className="font-medium text-blue-200">{job.parameters.mutationRate}</span>
              </div>
              <div className="flex justify-between">
                <span className="text-blue-400">Tournament Size:</span>
                <span className="font-medium text-blue-200">{job.parameters.tournamentSize}</span>
              </div>
              <div className="flex justify-between">
                <span className="text-blue-400">Elite Size:</span>
                <span className="font-medium text-blue-200">{job.parameters.eliteSize}</span>
              </div>
              <div className="flex justify-between">
                <span className="text-blue-400">Population Size:</span>
                <span className="font-medium text-blue-200">{job.parameters.populationSize}</span>
              </div>
            </div>
          </div>
        )}
      </CardContent>
    </Card>
  )
}

const StatCard = ({ icon: Icon, label, value, color, trend }) => (
  <Card className="overflow-hidden border-gray-700/50 shadow-2xl bg-gradient-to-br from-gray-800 to-gray-900">
    <CardContent className="p-6">
      <div className="flex items-center justify-between">
        <div className="space-y-2">
          <p className="text-sm font-medium text-gray-400">{label}</p>
          <p className="text-3xl font-bold text-white">{value}</p>
          {trend && (
            <div className="flex items-center text-sm text-emerald-400">
              <TrendingUp className="w-4 h-4 mr-1" />
              {trend}
            </div>
          )}
        </div>
        <div className={`p-3 rounded-full ${color}`}>
          <Icon className="w-6 h-6 text-white" />
        </div>
      </div>
    </CardContent>
  </Card>
)

export default function AsyncJobManager() {
  const [selectedJobType, setSelectedJobType] = useState("simulate")

  // Terrain simulation inputs
  const [terrainSize, setTerrainSize] = useState("400")
  const [noise, setnoise] = useState("0.5")
  const [smoothness, setSmoothness] = useState("0.5")
  const [maxIterations, setMaxIterations] = useState("50")
  const [depthMin, setDepthMin] = useState("5")
  const [depthMax, setDepthMax] = useState("30")
  const [volumeMin, setVolumeMin] = useState("10")
  const [volumeMax, setVolumeMax] = useState("500")
  const [monetaryLimit, setMonetaryLimit] = useState("5000000")
  const [timeLimit, setTimeLimit] = useState("500000")
  const [fidelity, setFidelity] = useState("0.5")
  const [algorithm, setAlgorithm] = useState("greedy")
  const [seed, setSeed] = useState("")

  // Genetic/GeneticSingle-specific fields
  const [numGenerations, setNumGenerations] = useState("100")
  const [mutationRate, setMutationRate] = useState("0.1")
  const [tournamentSize, setTournamentSize] = useState("6")
  const [eliteSize, setEliteSize] = useState("3")
  const [populationSize, setPopulationSize] = useState("50")

  const [jobs, setJobs] = useState([])
  const [errors, setErrors] = useState({})
  const [isSubmitting, setIsSubmitting] = useState(false)
  const [lastUpdate, setLastUpdate] = useState(new Date())

  const loadJobs = async () => {
    try {
      const simulateList = await api.listJobs("simulate")
      setJobs(simulateList.sort((a, b) => new Date(b.created_at).getTime() - new Date(a.created_at).getTime()))
      setLastUpdate(new Date())
    } catch (error) {
      console.error("Failed to load jobs:", error)
    }
  }

  useEffect(() => {
    loadJobs()

    // Auto-refresh every 2 seconds
    const interval = setInterval(loadJobs, 2000)
    return () => clearInterval(interval)
  }, [])

  const handleSubmit = async () => {
    try {
      // Parse all inputs to numbers
      const parsedInputs = {
        fidelity: Number.parseFloat(fidelity),
        terrainSize: Number.parseInt(terrainSize),
        noise: Number.parseFloat(noise),
        smoothness: Number.parseFloat(smoothness),
        maxIterations: Number.parseInt(maxIterations),
        depthBounds: [Number.parseFloat(depthMin), Number.parseFloat(depthMax)],
        volumeBounds: [Number.parseFloat(volumeMin), Number.parseFloat(volumeMax)],
        monetaryLimit: Number.parseFloat(monetaryLimit),
        timeLimit: Number.parseFloat(timeLimit),
        algorithm: algorithm,
        seed: seed === "" ? undefined : Number.parseInt(seed),
      }

      // Add genetic/geneticSingle fields if relevant
      if (algorithm === "genetic" || algorithm === "geneticSingle") {
        parsedInputs.numGenerations = Number.parseInt(numGenerations)
        parsedInputs.mutationRate = Number.parseFloat(mutationRate)
        parsedInputs.tournamentSize = Number.parseInt(tournamentSize)
        parsedInputs.eliteSize = Number.parseInt(eliteSize)
        parsedInputs.populationSize = Number.parseInt(populationSize)
      }

      // Validate all inputs
      const validation = validateSimulateInputs(
        parsedInputs.terrainSize,
        parsedInputs.noise,
        parsedInputs.smoothness,
        parsedInputs.maxIterations,
        parsedInputs.depthBounds,
        parsedInputs.volumeBounds,
        parsedInputs.monetaryLimit,
        parsedInputs.timeLimit,
      )

      if (!validation.isValid) {
        setErrors(validation.errors)
        return
      }

      setIsSubmitting(true)
      setErrors({})

      const inputData = {
        fidelity: parsedInputs.fidelity,
        terrainSize: parsedInputs.terrainSize,
        noise: parsedInputs.noise,
        smoothness: parsedInputs.smoothness,
        maxIterations: parsedInputs.maxIterations,
        depthBounds: parsedInputs.depthBounds,
        volumeBounds: parsedInputs.volumeBounds,
        monetaryLimit: parsedInputs.monetaryLimit,
        timeLimit: parsedInputs.timeLimit,
        algorithm: parsedInputs.algorithm,
        seed: parsedInputs.seed,
      }

      console.log("Submitting job with data:", inputData)

      await api.createJob("simulate", inputData)

      // Clear form
      setFidelity("0.5")
      setTerrainSize("400")
      setnoise("0.5")
      setSmoothness("0.5")
      setMaxIterations("100")
      setDepthMin("5")
      setDepthMax("30")
      setVolumeMin("10")
      setVolumeMax("500")
      setMonetaryLimit("50000000")
      setTimeLimit("500000")
      setAlgorithm("greedy")
      setSeed("")

      // Refresh job list
      await loadJobs()
    } catch (error) {
      console.error("Error creating job:", error)
      setErrors({ submit: error.message || "Failed to create job. Please try again." })
    } finally {
      setIsSubmitting(false)
    }
  }

  const handleDelete = async (jobId) => {
    try {
      await api.deleteJob("simulate", jobId)
      await loadJobs()
    } catch (error) {
      console.error("Failed to delete job:", error)
    }
  }

  const stats = {
    total: jobs.length,
    running: jobs.filter((job) => job.status === "running").length,
    completed: jobs.filter((job) => job.status === "completed").length,
    failed: jobs.filter((job) => job.status === "failed").length,
  }

  const successRate = stats.total > 0 ? Math.round((stats.completed / (stats.completed + stats.failed)) * 100) || 0 : 0

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-900 via-slate-900 to-black">
      {/* Header */}
      <div className="bg-gray-900/90 backdrop-blur-sm shadow-xl border-b border-gray-700/50 sticky top-0 z-50">
        <div className="max-w-7xl mx-auto px-6 py-6">
          <div className="flex items-center justify-between">
            <div className="flex items-center space-x-4">
              <div className="w-12 h-12 bg-gradient-to-br from-blue-600 via-purple-600 to-indigo-600 rounded-xl flex items-center justify-center shadow-lg">
                <Zap className="w-7 h-7 text-white" />
              </div>
              <div>
                <h1 className="text-3xl font-bold bg-gradient-to-r from-white to-gray-300 bg-clip-text text-transparent">
                  Terrain Simulation Manager
                </h1>
                <p className="text-gray-400">Advanced async terrain simulation dashboard</p>
              </div>
            </div>
            <div className="flex items-center space-x-4">
              <Badge variant="outline" className="text-xs border-gray-600 text-gray-300">
                <Clock className="w-3 h-3 mr-1" />
                Last updated: {lastUpdate.toLocaleTimeString()}
              </Badge>
            </div>
          </div>
        </div>
      </div>

      <div className="max-w-7xl mx-auto px-6 py-8">
        {/* Stats Cards */}
        <div className="grid grid-cols-1 md:grid-cols-4 gap-6 mb-8">
          <StatCard
            icon={Activity}
            label="Total Jobs"
            value={stats.total}
            color="bg-gradient-to-br from-blue-500 to-blue-600"
          />
          <StatCard
            icon={Loader}
            label="Running"
            value={stats.running}
            color="bg-gradient-to-br from-amber-500 to-orange-500"
          />
          <StatCard
            icon={CheckCircle}
            label="Completed"
            value={stats.completed}
            color="bg-gradient-to-br from-emerald-500 to-green-600"
          />
          <StatCard
            icon={TrendingUp}
            label="Success Rate"
            value={`${successRate}%`}
            color="bg-gradient-to-br from-purple-500 to-indigo-600"
            trend={successRate >= 80 ? "Excellent performance" : "Needs attention"}
          />
        </div>

        {/* Create Job Form */}
        <Card className="mb-8 border-gray-700/50 shadow-2xl bg-gradient-to-br from-gray-800 to-gray-900">
          <CardHeader className="pb-6">
            <div className="flex items-center space-x-3">
              <div className="w-10 h-10 bg-gradient-to-br from-green-500 to-emerald-600 rounded-xl flex items-center justify-center shadow-lg">
                <Play className="w-5 h-5 text-white" />
              </div>
              <div>
                <CardTitle className="text-2xl text-white">Create New Simulation</CardTitle>
                <CardDescription className="text-gray-400">
                  Configure and launch a new terrain simulation job
                </CardDescription>
              </div>
            </div>
          </CardHeader>

          <CardContent className="space-y-6">
            {errors.submit && (
              <Alert variant="destructive">
                <AlertTriangle className="h-4 w-4" />
                <AlertDescription>{errors.submit}</AlertDescription>
              </Alert>
            )}

            <form
              onSubmit={(e) => {
                e.preventDefault()
                handleSubmit()
              }}
              className="space-y-6"
            >
              {/* Algorithm selection */}
              <div className="space-y-2">
                <Label htmlFor="algorithm" className="text-base font-semibold text-gray-200">
                  Algorithm <span className="text-red-400">*</span>
                </Label>
                <Select value={algorithm} onValueChange={setAlgorithm}>
                  <SelectTrigger className="h-12">
                    <SelectValue placeholder="Select algorithm" />
                  </SelectTrigger>
                  <SelectContent>
                    <SelectItem value="genetic">Genetic (Full Solution)</SelectItem>
                    <SelectItem value="geneticSingle">Genetic (Single Well)</SelectItem>
                    <SelectItem value="greedy">Greedy</SelectItem>
                  </SelectContent>
                </Select>
              </div>

              <Separator className="bg-gray-700" />

              <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
                <div className="space-y-2">
                  <Label htmlFor="terrainSize" className="font-medium text-gray-200">
                    Terrain Size <span className="text-red-400">*</span>
                  </Label>
                  <Input
                    id="terrainSize"
                    type="number"
                    min="100"
                    max="1000"
                    value={terrainSize}
                    onChange={(e) => {
                      setTerrainSize(e.target.value)
                      if (errors.terrainSize) {
                        setErrors((prev) => ({ ...prev, terrainSize: null }))
                      }
                    }}
                    className={`h-12 ${errors.terrainSize ? "border-destructive" : ""}`}
                    placeholder="100-1000"
                  />
                  {errors.terrainSize && (
                    <p className="text-destructive text-sm flex items-center">
                      <AlertTriangle className="w-4 h-4 mr-1" />
                      {errors.terrainSize}
                    </p>
                  )}
                </div>

                <div className="space-y-2">
                  <Label htmlFor="noise" className="font-medium text-gray-200">
                    Noise Level <span className="text-red-400">*</span>
                  </Label>
                  <Input
                    id="noise"
                    type="number"
                    min="0"
                    max="1"
                    step="0.1"
                    value={noise}
                    onChange={(e) => {
                      setnoise(e.target.value)
                      if (errors.noise) {
                        setErrors((prev) => ({ ...prev, noise: null }))
                      }
                    }}
                    className={`h-12 ${errors.noise ? "border-destructive" : ""}`}
                    placeholder="0-1"
                  />
                  {errors.noise && (
                    <p className="text-destructive text-sm flex items-center">
                      <AlertTriangle className="w-4 h-4 mr-1" />
                      {errors.noise}
                    </p>
                  )}
                </div>

                <div className="space-y-2">
                  <Label htmlFor="smoothness" className="font-medium text-gray-200">
                    Smoothness <span className="text-red-400">*</span>
                  </Label>
                  <Input
                    id="smoothness"
                    type="number"
                    min="0.1"
                    step="0.1"
                    value={smoothness}
                    onChange={(e) => {
                      setSmoothness(e.target.value)
                      if (errors.smoothness) {
                        setErrors((prev) => ({ ...prev, smoothness: null }))
                      }
                    }}
                    className={`h-12 ${errors.smoothness ? "border-destructive" : ""}`}
                  />
                  {errors.smoothness && (
                    <p className="text-destructive text-sm flex items-center">
                      <AlertTriangle className="w-4 h-4 mr-1" />
                      {errors.smoothness}
                    </p>
                  )}
                </div>

                <div className="space-y-2">
                  <Label htmlFor="maxIterations" className="font-medium text-gray-200">
                    Max Iterations <span className="text-red-400">*</span>
                  </Label>
                  <Input
                    id="maxIterations"
                    type="number"
                    min="1"
                    max="1000"
                    value={maxIterations}
                    onChange={(e) => {
                      setMaxIterations(e.target.value)
                      if (errors.maxIterations) {
                        setErrors((prev) => ({ ...prev, maxIterations: null }))
                      }
                    }}
                    className={`h-12 ${errors.maxIterations ? "border-destructive" : ""}`}
                  />
                  {errors.maxIterations && (
                    <p className="text-destructive text-sm flex items-center">
                      <AlertTriangle className="w-4 h-4 mr-1" />
                      {errors.maxIterations}
                    </p>
                  )}
                </div>

                <div className="space-y-2">
                  <Label className="font-medium text-gray-200">
                    Depth Bounds <span className="text-red-400">*</span>
                  </Label>
                  <div className="grid grid-cols-2 gap-2">
                    <Input
                      type="number"
                      min="0"
                      max="100"
                      value={depthMin}
                      onChange={(e) => {
                        setDepthMin(e.target.value)
                        if (errors.depthBounds) {
                          setErrors((prev) => ({ ...prev, depthBounds: null }))
                        }
                      }}
                      className={`h-12 ${errors.depthBounds ? "border-destructive" : ""}`}
                      placeholder="Min"
                    />
                    <Input
                      type="number"
                      min="0"
                      max="100"
                      value={depthMax}
                      onChange={(e) => {
                        setDepthMax(e.target.value)
                        if (errors.depthBounds) {
                          setErrors((prev) => ({ ...prev, depthBounds: null }))
                        }
                      }}
                      className={`h-12 ${errors.depthBounds ? "border-destructive" : ""}`}
                      placeholder="Max"
                    />
                  </div>
                  {errors.depthBounds && (
                    <p className="text-destructive text-sm flex items-center">
                      <AlertTriangle className="w-4 h-4 mr-1" />
                      {errors.depthBounds}
                    </p>
                  )}
                </div>

                <div className="space-y-2">
                  <Label className="font-medium text-gray-200">
                    Volume Bounds <span className="text-red-400">*</span>
                  </Label>
                  <div className="grid grid-cols-2 gap-2">
                    <Input
                      type="number"
                      min="0"
                      max="1000"
                      value={volumeMin}
                      onChange={(e) => {
                        setVolumeMin(e.target.value)
                        if (errors.volumeBounds) {
                          setErrors((prev) => ({ ...prev, volumeBounds: null }))
                        }
                      }}
                      className={`h-12 ${errors.volumeBounds ? "border-destructive" : ""}`}
                      placeholder="Min"
                    />
                    <Input
                      type="number"
                      min="0"
                      max="1000"
                      value={volumeMax}
                      onChange={(e) => {
                        setVolumeMax(e.target.value)
                        if (errors.volumeBounds) {
                          setErrors((prev) => ({ ...prev, volumeBounds: null }))
                        }
                      }}
                      className={`h-12 ${errors.volumeBounds ? "border-destructive" : ""}`}
                      placeholder="Max"
                    />
                  </div>
                  {errors.volumeBounds && (
                    <p className="text-destructive text-sm flex items-center">
                      <AlertTriangle className="w-4 h-4 mr-1" />
                      {errors.volumeBounds}
                    </p>
                  )}
                </div>

                <div className="space-y-2">
                  <Label htmlFor="monetaryLimit" className="font-medium text-gray-200">
                    Monetary Limit <span className="text-red-400">*</span>
                  </Label>
                  <Input
                    id="monetaryLimit"
                    type="number"
                    min="0"
                    value={monetaryLimit}
                    onChange={(e) => {
                      setMonetaryLimit(e.target.value)
                      if (errors.monetaryLimit) {
                        setErrors((prev) => ({ ...prev, monetaryLimit: null }))
                      }
                    }}
                    className={`h-12 ${errors.monetaryLimit ? "border-destructive" : ""}`}
                  />
                  {errors.monetaryLimit && (
                    <p className="text-destructive text-sm flex items-center">
                      <AlertTriangle className="w-4 h-4 mr-1" />
                      {errors.monetaryLimit}
                    </p>
                  )}
                </div>

                <div className="space-y-2">
                  <Label htmlFor="timeLimit" className="font-medium text-gray-200">
                    Time Limit <span className="text-red-400">*</span>
                  </Label>
                  <Input
                    id="timeLimit"
                    type="number"
                    min="0"
                    value={timeLimit}
                    onChange={(e) => {
                      setTimeLimit(e.target.value)
                      if (errors.timeLimit) {
                        setErrors((prev) => ({ ...prev, timeLimit: null }))
                      }
                    }}
                    className={`h-12 ${errors.timeLimit ? "border-destructive" : ""}`}
                  />
                  {errors.timeLimit && (
                    <p className="text-destructive text-sm flex items-center">
                      <AlertTriangle className="w-4 h-4 mr-1" />
                      {errors.timeLimit}
                    </p>
                  )}
                </div>

                <div className="space-y-2">
                  <Label htmlFor="fidelity" className="font-medium text-gray-200">
                    Fidelity <span className="text-red-400">*</span>
                  </Label>
                  <Input
                    id="fidelity"
                    type="number"
                    min="0.1"
                    max="1.0"
                    step="0.1"
                    value={fidelity}
                    onChange={(e) => setFidelity(e.target.value)}
                    className="h-12"
                    placeholder="0.1-1.0"
                  />
                </div>

                <div className="space-y-2">
                  <Label htmlFor="seed" className="font-medium text-gray-200">
                    Seed (optional)
                  </Label>
                  <Input
                    id="seed"
                    type="number"
                    value={seed}
                    onChange={(e) => setSeed(e.target.value)}
                    className="h-12"
                    placeholder="Random if left blank"
                  />
                </div>
              </div>

              {/* Genetic/GeneticSingle-specific fields */}
              {(algorithm === "genetic" || algorithm === "geneticSingle") && (
                <>
                  <Separator className="bg-gray-700" />
                  <div className="space-y-4">
                    <h3 className="text-lg font-semibold flex items-center gap-2 text-white">
                      <Settings className="w-5 h-5" />
                      Genetic Algorithm Parameters
                    </h3>
                    <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
                      <div className="space-y-2">
                        <Label htmlFor="numGenerations" className="font-medium text-gray-200">
                          Number of Generations
                        </Label>
                        <Input
                          id="numGenerations"
                          type="number"
                          min="1"
                          max="1000"
                          value={numGenerations}
                          onChange={(e) => setNumGenerations(e.target.value)}
                          className="h-12"
                          placeholder="e.g. 100"
                        />
                      </div>
                      <div className="space-y-2">
                        <Label htmlFor="mutationRate" className="font-medium text-gray-200">
                          Mutation Rate
                        </Label>
                        <Input
                          id="mutationRate"
                          type="number"
                          min="0"
                          max="1"
                          step="0.01"
                          value={mutationRate}
                          onChange={(e) => setMutationRate(e.target.value)}
                          className="h-12"
                          placeholder="e.g. 0.1"
                        />
                      </div>
                      <div className="space-y-2">
                        <Label htmlFor="tournamentSize" className="font-medium text-gray-200">
                          Tournament Size
                        </Label>
                        <Input
                          id="tournamentSize"
                          type="number"
                          min="1"
                          max="20"
                          value={tournamentSize}
                          onChange={(e) => setTournamentSize(e.target.value)}
                          className="h-12"
                          placeholder="e.g. 6"
                        />
                      </div>
                      <div className="space-y-2">
                        <Label htmlFor="eliteSize" className="font-medium text-gray-200">
                          Elite Size
                        </Label>
                        <Input
                          id="eliteSize"
                          type="number"
                          min="1"
                          max="20"
                          value={eliteSize}
                          onChange={(e) => setEliteSize(e.target.value)}
                          className="h-12"
                          placeholder="e.g. 3"
                        />
                      </div>
                      <div className="space-y-2">
                        <Label htmlFor="populationSize" className="font-medium text-gray-200">
                          Population Size
                        </Label>
                        <Input
                          id="populationSize"
                          type="number"
                          min="1"
                          max="1000"
                          value={populationSize}
                          onChange={(e) => setPopulationSize(e.target.value)}
                          className="h-12"
                          placeholder="e.g. 50"
                        />
                      </div>
                    </div>
                  </div>
                </>
              )}

              <div className="pt-4">
                <Button
                  type="submit"
                  disabled={isSubmitting}
                  className="w-full h-12 text-base font-semibold bg-gradient-to-r from-blue-600 to-purple-600 hover:from-blue-700 hover:to-purple-700 shadow-xl border-0"
                >
                  {isSubmitting ? (
                    <>
                      <Loader className="w-4 h-4 mr-2 animate-spin" />
                      Creating Simulation...
                    </>
                  ) : (
                    <>
                      <Rocket className="w-4 h-4 mr-2" />
                      Create Simulation
                    </>
                  )}
                </Button>
              </div>
            </form>
          </CardContent>
        </Card>

        {/* Job List */}
        <div className="space-y-6">
          <div className="flex items-center justify-between">
            <h2 className="text-2xl font-bold flex items-center gap-3 text-white">
              <div className="w-8 h-8 bg-gradient-to-br from-indigo-500 to-purple-600 rounded-lg flex items-center justify-center">
                <Activity className="w-4 h-4 text-white" />
              </div>
              Job History
            </h2>
            <Badge variant="secondary" className="text-sm bg-gray-700 text-gray-300 border-gray-600">
              {jobs.length} total jobs
            </Badge>
          </div>

          {jobs.length === 0 ? (
            <Card className="border-gray-700/50 shadow-2xl bg-gradient-to-br from-gray-800 to-gray-900">
              <CardContent className="flex flex-col items-center justify-center py-12 text-center">
                <div className="w-16 h-16 bg-gray-700 rounded-full flex items-center justify-center mb-4">
                  <Activity className="w-8 h-8 text-gray-400" />
                </div>
                <h3 className="text-lg font-semibold text-white mb-2">No simulations yet</h3>
                <p className="text-gray-400">Create your first terrain simulation to get started.</p>
              </CardContent>
            </Card>
          ) : (
            <div className="space-y-6">
              {jobs.map((job) => (
                <JobCard key={job.id} job={job} onDelete={handleDelete} />
              ))}
            </div>
          )}
        </div>
      </div>
    </div>
  )
}
